import React from 'react';
import report from './report.jpg';
import './styles.css';

const Reports = () => {
  return (
    <center><div>
      <div class="container">
      <h2>Reports</h2>
      <img src={report} alt="Sample" />
      </div></div></center>

  );
};

export default Reports;
